import React from "react";
import { Link } from "gatsby";
const NotFound = () => {
  return (
    <>
      <main className="principal">
        <h2>404!</h2>
        <p>
            Pagina nao encontrada ou removida. <Link to="/">Ir para home page</Link>
        </p>
      </main>
    </>
  );
};
export default NotFound;
